import Card from '../UI/Card';

import styles from './UsersList.module.css';

const UsersList = (props) => {
  const { users } = props;

  let layout = users.map(({ name, age }) => <li key={ Math.random() }>`${ name } (${ age } years old)`</li>);

  if (!users.length()) {
    layout = <h1>No users...</h1>
  }

  return (
    <Card className={ styles.users }>
      <ul>
        { layout }
      </ul>
    </Card>
  );
};

export default UsersList;
